import styled from 'styled-components';

import Header from '../../components/Header';
import Footer from '../../components/Footer';

const Container = styled.div`
	background: #000;
`;

const Video = styled.video`
`;





const watch = (props) => (
	<Container>
		<Header />
		<Footer />
	</Container>
)

export default watch;
